  import React from 'react';
import Dropdown from './dropdown/dropdown';
import Navbar from './nav/navbar'


const Home = () => {
  return (
    <div
      style={{
        display: 'flex',
        justifyContent: 'center',
        alignItems: 'center',
        height: '90vh'
      }}
    >
      <Dropdown />
      <Navbar />
      <h1>Home</h1>
    </div>
  );
};

export default Home;
